import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Logo from 'components/Logo';

export default class NavigationBarLayout extends Component {
  renderLink = (link, path) => {
    return (
      <div
        key={link.text}
        style={{ marginBottom: 20, position: 'relative' }}
        className={path === link.to ? 'Highlight' : ''}
      >
        {link.space && (
          <div>
            <br />
          </div>
        )}
        <Link to={link.to}>
          <i
            className={
              'icon fas fa-' +
              link.icon +
              (path === link.to ? ' Highlight' : '')
            }
          ></i>
          {link.text.toUpperCase()}
        </Link>
        {/* 
        (path === link.to) && <div style={{position: "absolute", right: -10, top: -1, zIndex: 100, hover: {color: "#5558EA"}}}><i className="fas fa-circle" style={{fontSize: 6,color: "#5558EA"}}></i></div> 
        */}
      </div>
    );
  };

  render() {
    var parts = this.props.location.pathname.split('/');
    var path = '/' + parts[1] + (parts[2] ? '/' + parts[2] : '');
    var links = [
      // { to: '/app', tooltip: 'homepage', icon: 'home', text: 'Home' },
      {
        to: '/app/survey',
        icon: 'th-list',
        tooltip: 'homepage',
        text: 'Survey',
      },
      {
        to: '/app/results',
        icon: 'poll-h',
        tooltip: 'homepage',
        text: 'Matches',
      },
      { to: '/app/profile', text: 'Profile', icon: 'user' },
      {
        to: '/app/settings',
        icon: 'cog',
        space: false,
        tooltip: 'settings',
        text: 'Settings',
      },
      ...(this.props.admin
        ? [
            {
              to: '/app/admin',
              text: 'Admin',
              icon: 'toolbox',
            },
          ]
        : []),
    ];

    var bottom_links = [
      {
        to: '/app/feedback',
        icon: 'kiwi-bird',
        tooltip: 'homepage',
        text: 'Feedback',
      },
      { to: '/app/faq', icon: 'question', tooltip: 'homepage', text: 'FAQ' },
    ];

    return (
      <div className={'Navigation'}>
        <div style={{ textAlign: 'center', width: '100%' }}>
          <Logo to="/app" large />
        </div>
        <br />
        <div style={{ height: 25, textAlign: 'left' }} />
        {links.map(link => {
          return this.renderLink(link, path);
        })}
        <div style={{ position: 'absolute', bottom: 30 }}>
          {bottom_links.map(link => {
            return this.renderLink(link, path);
          })}
          <div
            onClick={this.props.logoutUser}
            style={{ cursor: 'pointer', color: '#515151' }}
          >
            {<i className="icon fas fa-sign-out-alt"></i>}
            LOG OUT
          </div>
        </div>
      </div>
    );
  }
}
